import { ChangeDetectionStrategy, Component } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { NavbarComponent } from './layout/navbar/navbar.component';
import { HeroComponent } from './features/hero/hero.component';
import { AboutComponent } from './features/about/about.component';
import { ProjectsGalleryComponent } from './features/projects/projects-gallery.component';
import { TechStackComponent } from './features/tech-stack/tech-stack.component';
import { ContactComponent } from './features/contact/contact.component';
import { ExperienceTimelineComponent } from './features/experience/experience-timeline.component';
import { RevealDirective } from './shared/directives/reveal.directive';

@Component({
  selector: 'app-root',
  standalone: true,
  changeDetection: ChangeDetectionStrategy.OnPush,
  imports: [
    RouterOutlet,
    NavbarComponent,
    HeroComponent,
    AboutComponent,
    ContactComponent,
    ExperienceTimelineComponent,
    RevealDirective
  ],
  template: `
    <app-navbar></app-navbar>
    <main class="min-h-screen">
      <app-hero></app-hero>
      <app-about appReveal></app-about>
      <app-experience-timeline appReveal></app-experience-timeline>
      <app-tech-stack appReveal></app-tech-stack>
      <app-projects-gallery appReveal></app-projects-gallery>
      <app-contact appReveal></app-contact>
      <router-outlet></router-outlet>
    </main>
    <footer class="py-12 border-t border-white/5 text-center text-slate-500 text-sm">
      &copy; 2026 RAZA HABIB. Built with Angular 19 & Signals.
    </footer>
  `,
  styles: [`
    :host {
      display: block;
    }
  `]
})
export class AppComponent {
  title = 'senior-portfolio';
}
